import React from 'react';
// eslint-disable-next-line
import ReactDOM from 'react-dom';
const AppHeader  = () => {//react component
    return (<h1> My Todo list </h1>)
}
const SearchPanel = () => {
    return (<input placeholder="search" />)
}

const ToDoList = () => {
    const items = ['Learn React', 'Create awesome App']
    return (<ul>
        <li>{items[0]}  </li>
        <li>{items[1]}</li>
    </ul>)
}
const App = () =>{return (<div>
    <span> {(new Date()).toString()}</span>
   <AppHeader />  
   <SearchPanel />
   <ToDoList />
    </div>)}; //elements


//const el = React.createElement('h1', null, 'Hello World!!!') JS-syntax, after Babel
